import React from 'react';

import CustomExpandedBox from '../customExpandedBox';
/**
 * @file module:src/components/ExtendedLine/index.jsx  
 * @param {*} props
 * @param {number} props.index -   
 * @returns 
 */

export default function ExtendedTableRow(props){  
    

    console.log("THIS USER DATA",props.thisUserData);

    let accessData = props.thisUserData.currentAccess; 
    let addressData = props.thisUserData.currentAddress; 
    let jobData = props.thisUserData.currentJob; 
    let productData = props.thisUserData.productsBuyed; 


    return (   
        <div style={style.container}>
            <CustomExpandedBox
            boxWidth="20%"
            bgColor= "#ffb5bc"
            boxTitle= "Acesso do Usuário"
            boxHeight = "cacl(100% / 4)"
            fieldsList = {[{label: "Rede",fieldKey: "user_access_business_technoloy"},
            {label: "Login",fieldKey: "user_access_login"},
            {label: "Navegadores",fieldKey: "user_access_user_agent"},
            {label: "IP",fieldKey: "user_access_ip_address"}]}
            fieldValues = {accessData}

            />

            <CustomExpandedBox
            boxWidth="20%"
            bgColor= "#ffb5bc"
            boxTitle= "Endereço do Usuário"
            boxHeight = "cacl(100% / 4)"
            fieldsList = {[{label: "País",fieldKey: "user_address_country"},
            {label: "Estado",fieldKey: "user_address_state"},
            {label: "Cidade",fieldKey: "user_address_city"},
            {label: "Rua",fieldKey: "user_address_street_name"},
            {label: "Endereco",fieldKey: "user_address_street_address"}]}
            fieldValues = {addressData}
            userId = {props.id}
            userIndex = {props.index}



            /> 

            <CustomExpandedBox
            boxWidth="20%"
            bgColor= "#ffb5bc"
            boxTitle= "Emprego do Usuário"
            boxHeight = "cacl(100% / 4)"
            fieldsList = {[{label: "Emprego",fieldKey: "currentJob"}]}
            fieldValues = {jobData}
            userId = {props.id}

            /> 

            <CustomExpandedBox
            boxWidth="20%"
            bgColor= "#ffb5bc"
            boxTitle= "Produto comprado"
            boxHeight = "cacl(100% / 4)"
            fieldsList = {[{label: "Produto",fieldKey: "productsBuyed"},
            {label: "Produto",fieldKey: "productsBuyed"}]}
            fieldValues = {productData}
            userId = {props.id}

            /> 
            
        </div>
    )
}


const style = {
    container: {
        width: "100%",
        height: "100%",
        flexDirection: "row",
        alignContent: "center"
    }
    

};
